      SELECT ALL - col0 + + col2 FROM tab0 (FORMAT parquet) WHERE NOT NULL NOT BETWEEN - col0 * + CAST ( - col1 AS INTEGER ) + + col0 AND NULL;
  - name: tab0

outputs:
  - name: q12890.out
    data: |
